import React from 'react';
import { Nav } from 'react-bootstrap';
import './AnimalSidebar.css';

const AnimalSidebar = () => {
  return (
    <div className="sidebar-section">
      <h5>Animales</h5>
      <Nav className="flex-column">
        <Nav.Link href="#">Perros en adopción</Nav.Link>
        <Nav.Link href="#">Gatos en adopción</Nav.Link>
        <Nav.Link href="#">Casos urgentes</Nav.Link>
        <Nav.Link href="#">Animales adoptados</Nav.Link>
      </Nav>
    </div>
  );
};

export default AnimalSidebar;
